import{_ as e,o as t,c as r,a as o}from"./app.04ed3e28.js";const m=JSON.parse('{"title":"Overriding Chrome settings","description":"","frontmatter":{},"headers":[{"level":2,"title":"# Homepage, search provider, and startup pages","slug":"homepage-search-provider-and-startup-pages","link":"#homepage-search-provider-and-startup-pages","children":[]},{"level":2,"title":"# Customizing values","slug":"customizing-values","link":"#customizing-values","children":[]},{"level":2,"title":"# Reference","slug":"reference","link":"#reference","children":[]}],"relativePath":"chromedocs/In depth_ more topics/Overriding Chrome settings - Chrome Developers.md","lastUpdated":1679926139000}'),a={name:"chromedocs/In depth_ more topics/Overriding Chrome settings - Chrome Developers.md"},s=o(`<ul><li><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#others" target="_blank" rel="noreferrer">Homepage, search provider, and startup pages</a></li><li><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#customizing" target="_blank" rel="noreferrer">Customizing values</a></li><li><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#reference" target="_blank" rel="noreferrer">Reference</a></li></ul><h1 id="overriding-chrome-settings" tabindex="-1">Overriding Chrome settings <a class="header-anchor" href="#overriding-chrome-settings" aria-hidden="true">#</a></h1><p>Published on Friday, February 14, 2014 \u2022 Updated on Thursday, December 1, 2022</p><ul><li><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#others" target="_blank" rel="noreferrer">Homepage, search provider, and startup pages</a></li><li><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#customizing" target="_blank" rel="noreferrer">Customizing values</a></li><li><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#reference" target="_blank" rel="noreferrer">Reference</a></li></ul><p>Caution</p><p>This page was migrated directly from the Manifest V2 documentation set. It has not yet been validated for compliance with Manifest V3.</p><p>Settings overrides are a way for extensions to override selected Chrome settings. The API is available on Windows in all current versions of Chrome and is available on Mac in Chrome 56 and later.</p><h2 id="homepage-search-provider-and-startup-pages" tabindex="-1"><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#others" target="_blank" rel="noreferrer">#</a> Homepage, search provider, and startup pages <a class="header-anchor" href="#homepage-search-provider-and-startup-pages" aria-hidden="true">#</a></h2><p>Here is an example how <a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#homepage" target="_blank" rel="noreferrer">homepage</a>, <a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#search_provider" target="_blank" rel="noreferrer">search provider</a>, and <a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#startup_pages" target="_blank" rel="noreferrer">startup pages</a> can be modified in the <a href="https://developer.chrome.com/docs/extensions/mv3/manifest/" target="_blank" rel="noreferrer">extension manifest</a>. Any domain used in the settings API must be <a href="https://support.google.com/webmasters/answer/35179" target="_blank" rel="noreferrer">verified</a> (via Google Search Console) by the same developer account publishing the extension. Note that if you verify ownership for a domain (for example, <a href="https://example.com" target="_blank" rel="noreferrer">https://example.com</a>) you can use any subdomain or page (for example, <a href="https://app.example.com" target="_blank" rel="noreferrer">https://app.example.com</a> or <a href="https://example.com/page.html" target="_blank" rel="noreferrer">https://example.com/page.html</a>) within your extension.</p><p>Starting in Chrome 107, if an extension only overrides the browser&#39;s search provider and provides no other capabilities, the post installation dialog box will not be shown.</p><pre><code>{  &quot;name&quot;: &quot;My extension&quot;,  ...  &quot;chrome_settings_overrides&quot;: {    &quot;homepage&quot;: &quot;https://www.homepage.com&quot;,    &quot;search_provider&quot;: {        &quot;name&quot;: &quot;name.__MSG_url_domain__&quot;,        &quot;keyword&quot;: &quot;keyword.__MSG_url_domain__&quot;,        &quot;search_url&quot;: &quot;https://www.foo.__MSG_url_domain__/s?q={searchTerms}&quot;,        &quot;favicon_url&quot;: &quot;https://www.foo.__MSG_url_domain__/favicon.ico&quot;,        &quot;suggest_url&quot;: &quot;https://www.foo.__MSG_url_domain__/suggest?q={searchTerms}&quot;,        &quot;instant_url&quot;: &quot;https://www.foo.__MSG_url_domain__/instant?q={searchTerms}&quot;,        &quot;image_url&quot;: &quot;https://www.foo.__MSG_url_domain__/image?q={searchTerms}&quot;,        &quot;search_url_post_params&quot;: &quot;search_lang=__MSG_url_domain__&quot;,        &quot;suggest_url_post_params&quot;: &quot;suggest_lang=__MSG_url_domain__&quot;,        &quot;instant_url_post_params&quot;: &quot;instant_lang=__MSG_url_domain__&quot;,        &quot;image_url_post_params&quot;: &quot;image_lang=__MSG_url_domain__&quot;,        &quot;alternate_urls&quot;: [          &quot;https://www.moo.__MSG_url_domain__/s?q={searchTerms}&quot;,          &quot;https://www.noo.__MSG_url_domain__/s?q={searchTerms}&quot;        ],        &quot;encoding&quot;: &quot;UTF-8&quot;,        &quot;is_default&quot;: true    },    &quot;startup_pages&quot;: [&quot;https://www.startup.com&quot;]   },   &quot;default_locale&quot;: &quot;de&quot;,   ...}
</code></pre><h2 id="customizing-values" tabindex="-1"><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#customizing" target="_blank" rel="noreferrer">#</a> Customizing values <a class="header-anchor" href="#customizing-values" aria-hidden="true">#</a></h2><p>Values in the manifest can be customized in the following ways:</p><ul><li><p>All values of the <code>search_provider</code>, <code>homepage</code>, and <code>startup_pages</code> properties can be localized using the <a href="https://developer.chrome.com/docs/extensions/reference/i18n/" target="_blank" rel="noreferrer"><code>chrome.i18n</code> API</a>.</p></li><li><p>For <a href="https://developer.chrome.com/docs/extensions/mv3/external_extensions/" target="_blank" rel="noreferrer">external extensions</a>, the <code>search_provider</code>, <code>homepage</code> and <code>startup_pages</code> URL values can be parametrized using a registry key. Create a new registry entry next to the <code>&quot;update_url&quot;</code> key (see instructions <a href="https://developer.chrome.com/docs/extensions/mv3/external_extensions/#registry" target="_blank" rel="noreferrer">here</a>). The key name is <code>&quot;install_parameter&quot;</code>, the value is an arbitrary string:</p><pre><code>{  &quot;update_url&quot;: &quot;https://clients2.google.com/service/update2/crx&quot;,  &quot;install_parameter&quot;: &quot;Value&quot;}
</code></pre><p>All occurrences of the substring <code>&quot;__PARAM__&quot;</code> in the manifest URLs will be substituted with the <code>&quot;install_parameter&quot;</code> value. If <code>&quot;install_parameter&quot;</code> is absent, occurrences of <code>&quot;__PARAM__&quot;</code> are removed. Note that <code>&quot;__PARAM__&quot;</code> cannot be part of the hostname. It needs to occur after the first &#39;/&#39; in the URL.</p></li></ul><h2 id="reference" tabindex="-1"><a href="https://developer.chrome.com/docs/extensions/mv3/settings_override/#reference" target="_blank" rel="noreferrer">#</a> Reference <a class="header-anchor" href="#reference" aria-hidden="true">#</a></h2><p>An extension can override one or more of the following properties in the manifest:</p><ul><li><p><strong><code>homepage</code> (string)</strong> - optional</p><p>New value for the homepage.</p></li><li><p><strong><code>search_provider</code> (object)</strong> - optional</p><p>A search engine</p><p>Type</p><p>Attribute</p><p>Description</p><p>string</p><p>(optional) name</p><p>Name of the search engine displayed to user. This may only be omitted if <em>prepopulated_id</em> is set.</p><p>string</p><p>(optional) keyword</p><p>Omnibox keyword for the search engine. This may only be omitted if <em>prepopulated_id</em> is set.</p><p>string</p><p>(optional) favicon_url</p><p>An icon URL for the search engine. This may only be omitted if <em>prepopulated_id</em> is set.</p><p>string</p><p>search_url</p><p>A search URL used by the search engine.</p><p>string</p><p>(optional) encoding</p><p>Encoding of the search term. This may only be omitted if <em>prepopulated_id</em> is set.</p><p>string</p><p>(optional) suggest_url</p><p>If omitted, this engine does not support suggestions.</p><p>string</p><p>(optional) image_url</p><p>If omitted, this engine does not support image search.</p><p>string</p><p>(optional) search_url_post_params</p><p>The string of post parameters to search_url</p><p>string</p><p>(optional) suggest_url_post_params</p><p>The string of post parameters to suggest_url</p><p>string</p><p>(optional) image_url_post_params</p><p>The string of post parameters to image_url</p><p>array of string</p><p>(optional) alternate_urls</p><p>A list of URL patterns that can be used, in addition to <em>search_url</em>.</p><p>integer</p><p>(optional) prepopulated_id</p><p>An ID of the built-in search engine in Chrome.</p><p>boolean</p><p>is_default</p><p>Specifies if the search provider should be default.</p></li><li><p><strong><code>startup_pages</code> (array of string)</strong> - optional</p></li></ul><p>An array of length one containing a URL to be used as the startup page.</p><p>Updated on Thursday, December 1, 2022 \u2022 <a href="https://github.com/GoogleChrome/developer.chrome.com/blob/main/site/en/docs/extensions/mv3/settings_override/index.md" target="_blank" rel="noreferrer">Improve article</a></p>`,19),n=[s];function i(p,l,d,u,c,h){return t(),r("div",null,n)}const g=e(a,[["render",i]]);export{m as __pageData,g as default};
